window.Shareable = class Shareable {
    
    constructor() {
        this.sharedData = new Map;
        this.observing = {};
    }

    
    isSharing(key) {
        return this.sharedData.has(key);
    }

    
    getShared(key) {
        let value = this.sharedData.get(key);

        return value;
    }

    observe(key, callback) {
        let observingList = this.observing[key] || [];

        observingList.push(callback);

        this.observing[key] = observingList;
    }

    
    pullShared(key) {
        let sharedValue = this.getShared(key);
        this.unshare(key);
        return sharedValue;
    }

    
    share(key, value) {
        this.sharedData.set(key, value);

        if (this.isObservable(key)) {
            this.trigger(key, value);
        }
        return this;
    }

    isObservable(key) {
        return typeof this.observing[key] != 'undefined';
    }

    trigger(key, value) {
        for (let callback of this.observing[key]) {
            callback(value);
        }
    }

    
    unshare(key) {
        this.sharedData.delete(key);
    }
}

