            let commentElement = document.getElementById(`cmnt${this.activeComment.id}`);
            scrollTo(
                commentElement,
                SCROLL_TOP_OFFSET,
                500
            );

            setTimeout(() => {
                this.activeComment = null;

                
            }, 2000);
