window.EinsteinPuzzlePage = class EinsteinPuzzlePage {
    
    constructor(meta, user, cache, router, einsteinChamberService) {
        this.meta = meta;
        this.user = user;
        this.cache = cache;
        this.router = router;
        this.einsteinChamberService = einsteinChamberService;
        this.name = 'einstein-puzzle';
        this.title = 'Einstein puzzle';
    }

    
    async init() {
        this.puzzleId = this.router.params.puzzleId;

        this.isLoading = true;
        this.startQuest = false;
        this.isValidForm = true;
        this.hideForm = false;

        this.answerData = this.cache.get(this.answerCacheKey) || '';

        this.errors = {
            answer: null,
        };

        this.puzzle = this.user.einsteinChamber ? this.user.einsteinChamber.currentPuzzle : null;

        if (this.puzzle && this.puzzle.id == this.puzzleId) {
            this.isLoading = false;
            this.answerCacheKey = `e-puzzle.${this.puzzle.id}`; 
            if (this.user.einsteinChamber.currentPuzzleCategory) {
                this.puzzle.category = this.user.einsteinChamber.currentPuzzleCategory;
            }
        }
        try {
            let response = await this.einsteinChamberService.getPuzzle(this.puzzleId);
            this.isLoading = false;
            this.puzzle = response.puzzle;
            if (this.puzzle.answer) {
                this.answerData = this.puzzle.answer;
            }
            this.meta.setTitle(`[${this.puzzle.category.name}] ${this.puzzle.title} - Einstein Chamber`)
                .setDescription(this.puzzle.quest.split("\n")[0] + ', Can you solve it?')
                .setImage(this.puzzle.category.image);
        } catch (e) {
            echo(e);
            if (e.error) {
                return this.router.navigateTo('/einstein-chamber');
            }
            throw new Error(e);
        }
    }

    getProperBadge(status) {
        return {
            'badge-warning': status == 'pending',
            'badge-success': status == 'approved',
            'badge-danger': status == 'rejected',
        };
    }

    
    async submitAnswer(form) {
        if (confirm('Are you sure you want to submit your answer?') === false) return;

        this.isSending = true;

        this.puzzle.status = 'pending';

        this.hideForm = true;

        try {
            this.cache.remove(this.answerCacheKey);
            this.answerData = '';
            let response = await this.einsteinChamberService.answerPuzzle(this.puzzle.id, form);
            this.startQuest = false;

            this.user.update(response.user);
            this.puzzle = response.puzzle;
            this.isSending = false;
        } catch (response) {
            echo(response);
            this.isSending = false;
        }
    }

    
    storeAnswer(answer) {
        this.cache.set(this.answerCacheKey, answer);
    }
};
window.EinsteinChamberShop = class EinsteinChamberShop {
    
    constructor(einsteinChamberService, user) {
        this.user = user;
        this.einsteinChamberService = einsteinChamberService;
        this.name = 'einstein-shop';
        this.title = 'Einstein Shop';
    }

    
    async init() {
        this.isLoading = true;
        this.isPurchasing = false;

        let shop = await this.einsteinChamberService.shop();

        
        this.categories = shop.categories.sort((categoryA, categoryB) => {
            let categoriesIds = this.user.einsteinChamber.categoriesIds;
            if (categoriesIds.includes(categoryA.id) === categoriesIds.includes(categoryB.id)) {
                if (this.canUnlock(categoryA) === this.canUnlock(categoryB)) {
                    return 0;
                } else if (this.canUnlock(categoryA)) {
                    return -1;
                } else {
                    return 1;
                }
            } else {
                return categoriesIds.includes(categoryA.id) ? -1 : 1;
            }
        });

        this.isLoading = false;
    }

    
    canUnlock(category) {
        return ! this.categoryIsUnlocked(category) && this.user.gold >= category.cost && this.user.total.academy.answers.approved >= category.requiredAnswers;
    }

    
    categoryIsUnlocked(category) {
        return this.user.einsteinChamber.categoriesIds.includes(category.id);
    }
};
