window.TopicPage = class TopicPage {
    
    constructor(meta, router, user, topicService, cache) {
        this.meta = meta;
        this.router = router;
        this.user = user;
        this.topicService = topicService;
        this.cache = cache;

        this.openAnswerText = false;
        this.approveMsg = {
            show: false,
            status: ''
        };

        this.startQuest = true;
        this.editMode = false;
        this.cancelBtn = false;
        this.currentUserAnswer;
        this.disableQuestBtn = false;
        this.btns = {
            'btn-primary': this.user.isLoggedIn(),
            'btn-danger': !this.user.isLoggedIn(),
        };

        this.name = 'topic';
        this.title = 'Topic';

        this.defaultAnswerDisplayMode = SEMI_DISPLAYED;
    }

    
    async init() {
        this.answerData = '';
        this.isValidForm = true; 
        this.isSending = false;
        this.errors = {
            answer: null,
        };

        this.topic = {};
        this.trackSlug = this.router.params.track;
        this.topicSlug = this.router.params.topic;
        this.trackID = this.router.params.track;
        this.answerCacheKey = `topic-answer.${this.topicSlug}`;

        
        
        

        this.topicService.getTopic(this.trackSlug, this.topicSlug).then(response => {
            this.setTopic(response.record);
            
        }).catch(e => {
            this.router.navigateTo('/academy');
        });
    }

    
    setTopic(topic) {
        this.topic = topic;
        this.title = this.topic.title;

        this.meta.setTitle(`[${this.topic.track.name}] ${this.topic.title}`)
            .setDescription(this.topic.shortDescription)
            .setImage(this.topic.track.image);

        this.answerData = this.cache.get(this.answerCacheKey);

        this.adjustTopic();

        if (!this.topic.answered || !this.topic.userAnswer) return;

        this.currentUserAnswer = this.topic.userAnswer;

        this.startQuest = false;
        this.approveMsg = {
            show: true,
            status: this.currentUserAnswer.status,
        };
        this.disableQuestBtn = true;
    }

    showQuestAnswer() {
        if (!this.user.isLoggedIn()) {
            return this.router.navigateTo('/login');
        }
        this.openAnswerText = !this.openAnswerText;
        if (this.openAnswerText === true) {
            this.btns = {
                'btn-primary': false,
                'btn-danger': true
            };
        } else {
            this.btns = {
                'btn-primary': true,
                'btn-danger': false
            };
        }
    }

    
    async submitAnswer(form) {
        
        
        

        if (!this.answerData) return alert('Empty answer!');

        this.isSending = true;
        this.startQuest = false;
        this.openAnswerText = false;

        let method = null,
            args = [];

        if (this.editMode) {
            method = 'editAnswer';
            args = [this.answerID, form];
        } else {
            method = 'applyAnswer';
            args = [this.topic.id, form];
        }

        

        let { topic } = await this.topicService[method](...args);
        this.topic = topic;

        
        this.cache.remove(this.answerCacheKey);

        this.adjustTopic();

        this.isValidForm = true;
        this.openAnswerText = false;
        this.disableQuestBtn = true;
        this.cancelBtn = false;
        this.answerData = form.formHandler.value('answer');
        this.approveMsg = {
            show: true,
            status: 'pending'
        };
    }

    editAnswer(id, editedAnswer) {
        this.cancelBtn = true;
        this.editMode = true;
        this.answerID = id;

        if (!this.answerData) {
            this.answerData = editedAnswer;
        }

        this.openAnswerText = true;
        this.disableQuestBtn = false;
    }

    
    adjustTopic() {
        if (!Is.empty(this.topic.answers)) {
            this.topic.answers.forEach(answer => {
                answer.display = this.defaultAnswerDisplayMode;
            });
        }
    }

    
    storeAnswer(answer) {
        this.cache.set(this.answerCacheKey, answer);
        this.answerData = answer;
    }

    
    handleAnswerDisplay(answer) {
        if (answer.display === SEMI_DISPLAYED) {
            answer.display = DISPLAYED;
        } else if (answer.display === HIDDEN) {
            answer.display = SEMI_DISPLAYED;
        } else if (answer.display === DISPLAYED) {
            answer.display = HIDDEN;
        }

        this.detectChanges();
    }
}

const DISPLAYED = 'd';
const HIDDEN = 'h';
const SEMI_DISPLAYED = 'sd';;
window.TrackCard = class TrackCard {
    
    constructor(user) {
        this.user = user;        
        this.track = null; 
    }

    init() {
        this.track = this.inputs.getProp('track');
    }

    
    isSubscriable() {
        return this.user.isLoggedIn() && ! this.user.academy.tracksIds.includes(this.track.id) && this.user.gold >= this.track.cost;
    }
};
window.TrackDetailsPage = class TrackDetailsPage {
    
    constructor(meta, router, tracksService, user, cache) {
        this.meta = meta;
        this.user = user;
        this.router = router;
        this.cache = cache;
        this.tracksService = tracksService;

        this.name = 'track';
        this.title = 'Track';
    }

    
    init() {
        this.suggestTopicTitle = '';
        this.errors = {};
        this.isValidForm = true;
        this.isSubmittingTopicSuggestion = false;
        this.topicSuggestionHasBeenSent = false;
        this.totalAnsweredTopics = 0;
        this.suggestTopic = false;
        this.disableBtn = false;
        this.myTopicsList = {}; 
        this.track = {};
        let trackSlug = this.router.params.track;

        if (this.cache.has('track-' + trackSlug)) {
            
        }

        this.isSubscribing = false;
        this.tracksService.getTrack(trackSlug).then(response => {
            this.setTrack(response.record);
            
        });
    }

    
    suggestNewTopic(form) {
        this.isSubmittingTopicSuggestion = true;
        this.tracksService.suggestTopic(this.track.id, form).then(response => {
            this.suggestTopic = false;
            this.topicSuggestionHasBeenSent = true;
            this.isSubmittingTopicSuggestion = false;
            
            setTimeout(() => {
                this.topicSuggestionHasBeenSent = false;
            }, 8000);
        });
    }

    
    openSuggestionSection() {
        if (! this.userCanSuggestNewTopics) return;

        this.suggestTopic = true;
    }

    
    setTrack(track) {
        this.track = track;
        this.title = this.track.name;
        
        this.track.topics = this.track.topics.sort((topicA, topicB) => {
            return topicB.answered == topicA.answered ? topicA.sortOrder - topicB.sortOrder : (topicA.answered ? 1 : -1);
        });

        let totalAnsweredTopics = this.track.topics.reduce((accumulator, topic) => {
            if (topic.answered && topic.userAnswer.status === 'approved') accumulator++;
            
            return accumulator;
        }, 0);

        this.meta.setTitle(this.track.name)
                 .setDescription(this.track.description)
                 .setImage(this.track.image);   

        this.totalAnsweredTopics = totalAnsweredTopics;

        this.userCanSuggestNewTopics = this.totalAnsweredTopics >= this.track.suggestTopic.requires;
    }

    
    getTopicReward(topic) {
        if (! topic.answered || ! topic.userAnswer) return topic.prize;

        let userAnswer;

        topic.answers.forEach(answer => {
            if (answer.by.id == this.user.id) {
                userAnswer = answer;
                return false;
            }
        });

        return userAnswer.status == 'approved' ? userAnswer.prize : topic.prize;
    }

    
    styleTopicBasedOnUserAnswer(topic) {
        if (! topic.answered || ! topic.userAnswer) return {};

        let classing = {
            status: true,
        };

        classing[topic.userAnswer.status] = true;

        return classing;
    }

    subscribeToTrack() {
        if (! this.user.isLoggedIn()) {
            this.router.navigateTo('/login');
            return;
        }
        if (this.user.gold < Number(this.track.cost)) {
            playAudio(Sounds.NOT_ENOUGH_GOLD_RANDOM());
            alert('You don\'t have enough gold');
            return;
        }
        
        this.isSubscribing = true;
        this.tracksService.applyToTrack(this.track.id).then(response => {
            playAudio(Sounds.PAY_COINS);
            this.user.update('gold', response.gold);
            this.track = response.record;
            this.isSubscribing = false;
        }).catch(e => {
            this.isSubscribing = false;
        });
    }

    
    myTopicAnswer(topic) {
        if (this.myTopicsList[topic.id]) return this.myTopicsList[topic.id];

        let answer = collect(topic.answers).first(answer => answer.by.id == this.user.id);

        return this.myTopicsList[topic.id] = answer;
    }

    
    ready() {}
};
