window.ChatRoomsPage = class ChatRoomsPage {
    
    constructor(user, chatRoomsService, meService) {
        this.user = user;
        this.chatRoomsService = chatRoomsService;
        this.meService = meService;

        this.name = 'chat-rooms';
        this.title = 'Chat rooms';
    }
    
    
    async init() {
        this.errors = {};
        this.isLoading = true;
        this.isSending = false;
        this.confirmJoin = false;
        this.joiningRoom = false;
        this.openAcceptanceCriteriaModal = false;

        let response = await this.chatRoomsService.list();
        this.chatRooms = response.records;

        this.isLoading = false;
    }

    
    submitAcceptanceCriteria(form) {
        this.currentForm = form;
        this.acceptanceModal.close();
        this.confirmJoin = true;
    }

    async joinRoom() {
        this.isSending = true;
        this.confirmJoin = null;
        let response = await this.chatRoomsService.joinRoom(this.joiningRoom.id, this.currentForm);

        this.joiningRoom = response.record;
        this.chatRooms[this.currentIndex] = response.record;
        this.user.update(response.user);
        this.isSending = false;
        this.joiningRoom = null;
    }

    userIsMemberOf(room) {
        return Array.get(room.members, member => member.id == this.user.id) != null;
    }

    userIsModeratorOf(room) {
        for (let member of room.members) {
            if (member.id == this.user.id && member.role != 'member') return true;
        }

        return false;
    }

    confirmingRoom(room, index) {
        this.joiningRoom = room;
        this.currentIndex = index;
        if (room.acceptanceCriteria) {
            this.openAcceptanceCriteriaModal = true;
        } else {
            this.confirmJoin = true;
        }
    }

    async getRoomRequests(room, index) {
        this.currentRoom = room;
        this.currentIndex = index;
        this.openRoomRequests = true;
        this.isLoadingRequests = true;
        this.roomRequests = [];

        let response = await this.chatRoomsService.getJoinRequests(room.id);

        this.roomRequests = response.roomRequests;

        this.isLoadingRequests = false;
    }

    approveRequest(roomRequest, index) {
        return this.applyActionToRoomRequest(roomRequest, index, 'approve');
    }

    declineRequest(roomRequest, index) {
        return this.applyActionToRoomRequest(roomRequest, index, 'decline');
    }

    applyActionToRoomRequest(roomRequest, index, status) {
        if (confirm('Are you sure ?') === false) return;

        delete this.roomRequests[index];

        this.roomRequests = Array.reset(this.roomRequests);

        let method = status == 'approve' ? 'approveJoinRequest' : 'declineJoinRequest';

        this.chatRoomsService[method](this.currentRoom.id, roomRequest.id).then(response => {
            this.chatRooms[this.currentIndex] = response.record;
        });
    }
    
    userIsRequestingToJoin(room) {
        return room.requests.includes(this.user.id);
    }
};
window.ChatRoomsPanel = class ChatRoomsPanel {
    
    constructor(user, router, meService, chatRoomsService) {
        this.user = user;
        this.router = router;
        this.meService = meService;
        this.chatRoomsService = chatRoomsService;

        this.chatRooms = [];
    }

    
    init() {
        this.input = '';
        this.lastSentMessage = null;
        this.openedRoom = null;
        this.chatRoomsAreOpened = false;
        this.openRoomsList = null;
        if (!userSocket) return;

        userSocket.chatRooms = this;

        userSocket.on('chat-rooms.new-message', data => {
            this.lastSentMessage = data;
            let { roomId, message } = data;

            for (let chatRoom of this.chatRooms) {
                if (chatRoom.id != roomId) continue;

                chatRoom.messages.push(message);

                if ((!this.openedRoom || this.openedRoom.id != chatRoom) && message.sender.id != this.user.id) {
                    this.increaseUnseenNotifications(roomId);
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                }
            }

            if (Is.empty(this.chatRooms)) {
                this.increaseUnseenNotifications(roomId);
            }
        });
    }

    navigateToChatRoomsPage() {
        this.close();
        this.router.navigateTo('/chat-rooms');
    }

    increaseUnseenNotifications(roomId) {
        if (!this.user.unseenRoomsNotifications.rooms[roomId]) {
            this.user.unseenRoomsNotifications.rooms[roomId] = 0;
        }

        this.user.unseenRoomsNotifications.total++;
        this.user.unseenRoomsNotifications.rooms[roomId]++;

        this.detectChanges();
    }

    playSound() {
        if (!this.lastSentMessage) return;

        if (! userInThePage() || !this.chatRoomsAreOpened || !this.openedRoom || this.lastSentMessage.roomId != this.openedRoom.id) {
            playAudio(Sounds.MESSAGE);
        }
    }

    openChatRooms() {
        if (!this.user.isLoggedIn() || Is.empty(this.user.chatRoomsIds)) {
            return this.router.navigateTo('/chat-rooms');
        }

        this.meService.chatRooms().then(response => {
            this.isLoading = false;
            this.chatRooms = response.chatRooms.map(room => {
                room.messages = [];

                return room;
            });
        });

        this.isLoading = true;

        this.chatRoomsAreOpened = true;

        setTimeout(() => {
            document.documentElement.classList.add('c-r');
        }, 600);
    }

    close() {
        this.chatRoomsAreOpened = false;

        document.documentElement.classList.remove('c-r');
    }

    async openRoom(room) {
        this.openedRoom = room;
        this.input = '';
        this.isLoadingMessages = true;
        if (Is.empty(room.messages)) {
            this.isLoadingMessages = true;
        } else {
            this.isLoadingMessages = false;
            this.clearUnseenNotifications();
            this.scrolled = false;
        }

        this.openRoomsList = false;

        let response = await this.chatRoomsService.messages(this.openedRoom.id);

        this.openedRoom.messages = response.messages;

        this.clearUnseenNotifications(false);

        this.scrolled = false;

        this.isLoadingMessages = false;
    }

    clearUnseenNotifications(detect = true) {
        let room = this.openedRoom;
        if (Object.get(this.user, `unseenRoomsNotifications.rooms.${room.id}`)) {
            this.user.unseenRoomsNotifications.total -= this.user.unseenRoomsNotifications.rooms[room.id];
            this.user.unseenRoomsNotifications.rooms[room.id] = 0;
        }

        if (detect) {
            this.detectChanges();
        }
    }

    sendMessage(input, e) {
        if (e.keyCode != 13 || !this.input) return;

        if (e.shiftKey) return;

        e.preventDefault();

        let message = this.input;

        let messageObject = {
            message,
            sender: this.user.info,
            createdAt: {
                format: new Date,
                timestamp: Date.now() / 1000,
            },
        };

        

        this.clearUnseenNotifications(false);

        this.input = '';

        
        this.writingIsArabic = false;

        userSocket.trigger(`chat-rooms.new-message`, {
            message: messageObject,
            roomId: this.openedRoom.id,
        });

        
        this.chatRoomsService.sendMessage(this.openedRoom.id, { message });
    }

    scrollToLastMessage() {
        if (this.scrolled) return;
        this.messagesList.scrollTop = this.messagesList.scrollHeight;

        this.scrolled = true;
    }

    
    formatDate(time) {
        let date = new Date(time.timestamp * 1000),
            hours = date.getHours(),
            minutes = date.getMinutes();

        
        if (minutes < 10) {
            minutes = '0' + minutes;
        }

        if (hours < 10) {
            hours = '0' + hours;
        }

        return `${hours}:${minutes}`;
    }
};
